import Header from "../components/Header";
import { User } from "../types/User";
import { UserRole } from "../types/User";
import { Activity } from "../types/Activity";

interface ViewUsersProps{
    users:User[]
    convertUser:(id:number,username:string,role:UserRole, activities:Activity[],password:string) =>User
}
function ViewUsers(props:ViewUsersProps):JSX.Element{

return(
<>
<Header/>
<h1>Users:</h1>
<ul>
{props.users.map((user) => (
    props.convertUser(user.id, user.username, user.role, user.activities, user.password)(
    <li key={user.id}>
        <h4>{user.username} id:{user.id}</h4>
        <h5>{user.activities.map((activity => (
            <p>{activity.title} {activity.date.toLocaleString('en-GB')}</p>
        )))}</h5>
    </li>
)))}


</ul>
</>
)
}

export default ViewUsers;
